      try {
        const res = await fetch('/api/items');
        const data = await res.json();
        console.log(data);
      } catch (error) {
        console.log(error);
      }
    };
  
    fetchVideo();
  }, []);
  

  
  return (
    <div className='hero'>
  <video alt="hello" src="/computer2.mp4" autoPlay loop muted/>
</div>
  )
}
